  useEffect(() => {
    fetch('data.json')
        .then(response => response.json())
        .then((json) => setData(json))
}, [])
  return (
    <div className="App">
      <header className="App-header">
        <ItemPost
          id={1}
          title="Пост 1"
          text={[ "Первый параграф ляляля", "Второй параграф", "тд и все" ]}
          imgSrc="https://img.freepik.com/free-photo/vertical-shot-of-a-gray-tabby-cat-sitting-on-a-white-surface-with-a-sleepy-face_181624-44747.jpg"
        />
      </header>
    </div>
  );
}

export default App;
